sources.scss/_contact.scss:
.contact {
  .info-section {
    width: 35%;
    position: absolute;
    top: 0;
    bottom: 0;
    left: 0;
    padding: 54px;

    .logo {
      border: 2px solid #fff;
      height: 40px;
      width: 40px;
      display: flex;
      justify-content: center;
      align-items: center;
      font-weight: 700;
      font-size: 40px;
      color: white;
    }

    .info-box {
      bottom: 60px;
      position: absolute;

      h4 {
        font-size: 1.2rem;
        color: $color3;
        margin: 0.7rem 0;
      }

      .phone {
        margin: 0 0 0.7rem 0;
      }

      p {
        font-size: 0.9rem;
        font-weight: 300;
        color: $color3;
        margin: 0.2rem 0 1.6rem;
      }
      a {
        color: white;
        text-decoration: none;
        //font-size: 2rem;;
      }
    }
    .icon-section {
      a {
        font-size: 1.5rem !important;
        padding: 0px 10px 0px 0px !important;
        &:hover {
          color: $hoveredColor1;
        }
      }
    }
  }

  .content-area {
    background: $color3;
    margin-left: 35%;
    width: 65%;
    background: white;
    height: 100%;
    //padding: 0 0 0 25%;

    .image-container {
      display: inline-block;
      width: 25%;
      position: relative;
      height: 100%;

      .form-section {
        overflow-y: scroll;
        overflow-x: hidden;
        position: absolute;
        top: 56px;
        left: -200px;
        width: 400px;
        height: calc(100% - 120px);
        background: $color2;
        color: $color3;
        padding: 46px;
        -webkit-box-shadow: 6px 16px 24px 5px rgba(15, 47, 171, 0.56);
        -moz-box-shadow: 6px 16px 24px 5px rgba(15, 47, 171, 0.56);
        box-shadow: 6px 16px 24px 5px rgba(15, 47, 171, 0.56);

        h4 {
          font-size: 1.6rem;
          margin-top: 1rem;
          margin-bottom: 2rem;
        }

        input[type="text"],
        input[type="email"],
        textarea {
          width: 100%;
          background: transparent;
          border: none;
          border-bottom: 2px solid $color5;
          margin-bottom: 2rem;
          font-size: 0.8rem;
          text-transform: uppercase;
          line-height: 1.2;
          color: $color5;
          padding: 15px 0;
        }

        button[type="submit"] {
          background: $color1;
          border: none;
          -webkit-border-radius: 30px;
          -moz-border-radius: 30px;
          border-radius: 30px;
          text-align: center;
          color: $color3;
          font-size: 1rem;
          padding: 17px 30px;
          text-transform: uppercase;
          width: 100%;
        }
      }
    }
  }

  .contact-section {
    vertical-align: top;
    display: inline-block;
    //max-width: 500px;
    padding: 56px 0 0;
    width: 70%;
    //float:  right;

    .contact-info {
      h1 {
        font-size: 2.3rem;
        font-weight: 500;
        line-height: 1.3;
        margin: 0 0 1rem;
        span {
          color: $color1;
        }
      }
      .contact-box {
        padding: 30px;
        transition: all 0.3s ease-in-out;
        &:hover {
          -webkit-box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
          -moz-box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
          box-shadow: 11px 14px 38px 5px rgba(216, 218, 232, 1);
        }
        cursor: pointer;
        h5 {
          font-size: 1.1rem;
          margin: 0 0 1.5rem;
          font-weight: 600;
        }
        p {
          color: $color5;
          font-weight: 300;
          line-height: 1.4;
          margin: 0 0 2rem;
        }
      }
    }
  }
}


